basic.src.services.NeighborsQuery.Export:
export interface ReqNeighborsQuery {
// The diffused node, which is an array of node IDs.
ids: string[];
// All information of the diffused node
nodes: any[];
// The degree of diffusion.
sep: number;
}

export interface GIGraphData {
nodes: {
// Node ID
id: string;
// The enumeration value of the node type. Property Graph is also called node.label
nodeType: string;
// Pay attention to the need to level up business data. Currently, nesting is not supported.
data: {};
// Which field in the business data is used to map the node type
nodeTypeKeyFromProperties? : string;
}[];
edges: {
// Edge ID
id: string;
// The ID of the source node associated with the edge.
source: string;
// The ID of the target node associated with the edge.
target: string;
// The enumerated value of the edge type. Property Graph is also called edge.label
edgeType: string;
// Pay attention to the need to level up business data. Currently, nesting is not supported.
data: {};
// Which field in the business data is used to map the edge type
edgeTypeKeyFromProperties? : string;
}[];
}

